// src/App.js
import React from 'react';
import Stock from './components/stock';

const App = () => {
    const stocks = ['IBM', 'AMZN', 'DOW', 'NASDAQ']; // List of stock tickers

    return (
        <div>
            <h1>Stock Dashboard</h1>
            {stocks.map(stock => <Stock key={stock} ticker={stock} />)}
        </div>
    );
}

export default App;
